import React from 'react'
import ReactDOM from 'react-dom'
import asabaneh from './images/asabeneh.jpg'



class Header extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return(
            <header>
                <div className="header-wrapper">
                    <h1>{this.props.title}</h1>
                </div>
            </header>
        )
    }
}
